import React from "react";
import { useHistory } from "react-router-dom";

const SlidingMenu = ({ isOpen, onClose }) => {
  const history = useHistory();

  const goToPages = (pageName) => {
    //props.onEntityClick(entityName, score, logo);
    history.push("/" + pageName);
  };
  return (
    <div className={`sliding-menu ${isOpen ? "open" : ""}`}>
      {/* Content of the menu */}
      <div className="close-button" onClick={onClose}>
        X
      </div>
      <div className="side-menu-container">
        <div className="each-menu" onClick={() => goToPages("")}>
          Entities Index
        </div>
        <div className="each-menu" onClick={() => goToPages("categoryList")}>
          Workforce index
        </div>
        <div className="each-menu">Digital skills Historical Scoring</div>
      </div>

      {/* Close button */}
    </div>
  );
};

export default SlidingMenu;
